import * as React from "react";
import Button from "@mui/material/Button";
import Dialog from "@mui/material/Dialog";
import DialogActions from "@mui/material/DialogActions";
import DialogContent from "@mui/material/DialogContent";
import DialogContentText from "@mui/material/DialogContentText";
import DialogTitle from "@mui/material/DialogTitle";
import { useState } from "react";
import { useNavigate } from "react-router-dom";

const TestStartPopUp = () => {
  const [open, setOpen] = useState(true);
  const navigate = useNavigate();
  const handleClose = () => {
    setOpen(false);
  };

  const handleRedirect = () => {
    navigate("/dashboard");
  };

  return (
    <div>
      <Dialog open={open} fullScreen onClose={handleClose}>
        <DialogTitle>Informacje o teście</DialogTitle>
        <DialogContent>
          <DialogContentText>
            Za chwilę rozpoczniesz test: "Test z inżynierii obliczeniowej 1".
            Czas przeznaczony na rozwiązanie testu: 45 minut Prowadzący: Imie i
            Nazwisko Data rozpoczęcia testu:
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleRedirect}>Strona główna</Button>
          <Button onClick={handleClose}>Rozpocznij test</Button>
        </DialogActions>
      </Dialog>
    </div>
  );
};

export default TestStartPopUp;
